import "./style.css";
import FormBtn from "../../components/ContactForm/FormBtn"


class News extends Component {
  state = {
    News: []
  };

  render() {
    return (
      <main id="news" className="section scrollspy container">
        <h1>More About Newark, NJ</h1>
        <FormBtn />
      </main>
    );
  }
}

export default News;
